import React from 'react';
import { Link } from 'react-router-dom';

const TabAuth = () => {
  return (
    <div class="auth-tab">
      <a class="auth-tab__link active" href="#">
        Регистрация
      </a>
      <a class="auth-tab__link" href="#">
        Авторизация
      </a>
    </div>
  );
};

export default TabAuth;
